// src/pages/QuemSomos.js
import React from 'react';

const QuemSomos = () => {
  return (
    <div>
      <h1>Quem Somos</h1>
      <p>A Nareia é uma organização dedicada ao esporte Beach Tennis. Nosso objetivo é promover eventos esportivos e criar uma comunidade apaixonada por Beach Tennis.</p>
      <p>Nosso time é composto por profissionais apaixonados pelo esporte, que buscam sempre oferecer as melhores experiências para os participantes.</p>
    </div>
  );
};

export default QuemSomos;
